import React ,{ useState }from 'react';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import Signup from '../Component/Signup'
import Login from '../Component/Login';
import AdditionalDetails from "../Component/Profile";
const homepage = () => {
    const [userId,setUserLog] =  useState ({});
    return (
        <>
        <Router>
        <Switch>
        <Route exact path="/" >
            <Login setUserLog={setUserLog}/>
        </Route>
        <Route exact path="/signup" component={Signup} />
        <Route exact path="/additionalDetails" >
            {
                userId && userId._id ? <AdditionalDetails setUserLog={setUserLog} />:<Login setUserLog={setUserLog}/>
            }
        </Route>

        </Switch>
        </Router>
        </>
    );
}
export default homepage;
